import React from 'react';
import logo from './logo.svg';
import './App.css';

import {Members} from './Members';
import CalendarModal from './CalendarModal';
function App() {
  console.log(Members);

  const onClickMember = (member) => {
    console.log(member);
  }
  let displayUsers = Members.members.map((item)=>{
  return (<React.Fragment><li className="list-group-item" onClick={()=>onClickMember(item)} key={item.id}>{item.real_name}</li>
         <CalendarModal member={item}/></React.Fragment>)
  })
  return (
    <div className="App">
      {/* <div className="calendar-rectangle">
        <div id="calendar-content" className="calendar-content"><Calendar/></div>
      </div> */}
      <button type="button" className="btn btn-primary" data-toggle="modal" data-target="#myModal">
  Open modal
</button>
<div className="container">
  <h2>Basic List Group</h2>
  <ul className="list-group">
    {displayUsers}
  </ul>
</div>
    </div>
  );
}

export default App;
